import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        {/* Define the routes */}
        <Routes>
          {/* Registration route */}
          <Route path="/register" element={<Register />} />

          {/* Login route */}
          <Route path="/login" element={<Login />} />

          {/* User Dashboard */}
          <Route path="/user-dashboard" element={<UserDashboard />} />

          {/* Ground Owner Dashboard */}
          <Route path="/groundowner-dashboard" element={<GroundOwnerDashboard />} />

          {/* Redirect to register by default */}
          <Route path="/" element={<Register />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
